import React, {Component} from 'react'
import {Image} from 'react-bootstrap'
import fluidimg from '../static/img/fluid-img.jpg'

class Home extends Component {
    render() {
        return (
            <div>
                <div id="part-1">
                    <Image src={fluidimg} fluid></Image>
                    <h1>
                        Welcome!
                    </h1>
                    <p>
                        Welcome to my website
                    </p>
                </div>

            </div>
        )
    }
}

export default Home;
